import React, { useState, useEffect } from 'react';
// import React, { useState, useEffect } from 'react';
import BlogData from './data.json';
import { NavLink } from 'react-router-dom';

function Rel(props) {
  const postId = props.match.params.num;
  const number = BlogData.data.find((x) => x.id !== postId);

  return (
    <div>
      {number.map((post) => {
        <h1>{post.blogTitle}</h1>;
      })}
    </div>
  );
}

export default Rel;
